import React, { useState } from "react";
const App=()=>{
    let p;
    const [val,changeval]=useState("");
    const [Value,changevalue]=useState("");
    const [finalname,setfinalname]=useState("");
    const [lastName,setlastname]=useState("");
    const fun=()=>{
        setfinalname(val);
        setlastname(Value);
        changeval("");
    }
    const fun1=(event)=>{
         p=event.target.value;
         changeval(p)
    }
    const fun2=(event)=>{
         changevalue(event.target.value);
    }
    return (
        <>
            <div className="CLICK">
            <h1>{`Hello ${finalname} ${lastName}`}</h1>
                <input type="text" placeholder={"Enter Your Name"}  onChange={fun1} value={val}/>
                <input type="text" placeholder={"Enter Your Last Name"}  onChange={fun2} value={Value}/>
                <button type="submit" onClick={fun} >Submit</button>
            </div>
        </>
    )
}
export default App;
